create table "public"."address" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "name" character varying not null,
    "street" character varying not null,
    "zip_code" character varying not null,
    "latitude" double precision,
    "longitude" double precision,
    "is_default" boolean not null default true,
    "user_id" uuid not null
);


create table "public"."billing" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "total_amount" real not null,
    "fees" real not null,
    "fliiinker_rate" real not null
);


create table "public"."channel" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "name" character varying not null
);


create table "public"."channel_user_mtm" (
    "channel_id" bigint not null,
    "created_at" timestamp with time zone not null default now(),
    "user_id" uuid not null
);


create table "public"."customer_rating" (
    "created_at" timestamp with time zone not null default now(),
    "rating" smallint not null,
    "comment" character varying,
    "comment_is_visible" boolean not null default false,
    "customer_id" uuid not null,
    "fliiinker_id" uuid not null default gen_random_uuid()
);


create table "public"."fliiinker_config" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "radius_max" smallint not null,
    "status" character varying not null,
    "active_days" character varying not null
);


create table "public"."fliiinker_profile" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "images" bigint,
    "description" character varying,
    "degree" character varying,
    "tagline" character varying,
    "radius_max" smallint not null,
    "status" character varying not null,
    "fliiinker_config_id" bigint not null,
    "public_profile_id" uuid
);


create table "public"."fliiinker_rating" (
    "created_at" timestamp with time zone not null default now(),
    "rating" smallint not null,
    "comment" character varying,
    "comment_is_visible" boolean not null default false,
    "fliiinker_id" uuid not null,
    "customer_id" uuid not null
);


create table "public"."fliiinker_service_mtm" (
    "service_id" bigint not null,
    "created_at" timestamp with time zone not null default now(),
    "is_active" boolean not null default false,
    "hourly_rate" smallint not null,
    "description" character varying,
    "options" jsonb,
    "fliiinker_id" uuid not null
);


create table "public"."fliiinker_service_rating" (
    "service_id" bigint not null,
    "created_at" timestamp with time zone not null default now(),
    "rating" smallint not null,
    "comment" character varying,
    "comment_is_visible" boolean not null default false,
    "fliiinker_id" uuid not null,
    "customer_id" uuid not null
);


create table "public"."linking" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "updated_at" timestamp with time zone not null default now(),
    "status" character varying not null,
    "search_id" bigint not null,
    "customer_id" uuid not null,
    "fliiinker_id" uuid not null
);


create table "public"."linking_event" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "name" character varying not null,
    "linking_id" bigint not null
);


create table "public"."message_chat" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "message" character varying not null,
    "channel_id" bigint not null,
    "sender_id" uuid not null
);


create table "public"."order" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "start_date" timestamp with time zone not null,
    "end_date" timestamp with time zone not null,
    "status" character varying not null,
    "order_metadata_id" bigint not null,
    "service_id" bigint not null,
    "billing_id" bigint,
    "channel_id" bigint,
    "customer_id" uuid not null,
    "fliiinker_id" uuid not null
);


create table "public"."order_metadata" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "customer_address_id" bigint not null,
    "fliiinker_address_id" bigint not null,
    "start_date" timestamp with time zone not null,
    "end_date" timestamp with time zone not null,
    "service_duration" real not null
);


create table "public"."public_profile" (
    "created_at" timestamp with time zone not null default now(),
    "email" character varying not null,
    "id" uuid not null,
    "email_confirmed_at" timestamp with time zone,
    "phone" text,
    "phone_confirmed_at" timestamp with time zone,
    "last_name" character varying,
    "first_name" character varying
);


create table "public"."search" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "status" character varying,
    "service_id" bigint
);


create table "public"."service" (
    "id" bigint generated by default as identity not null,
    "created_at" timestamp with time zone not null default now(),
    "name" character varying not null,
    "logo" character varying not null,
    "description" character varying not null,
    "body" character varying
);


create table "public"."user_search_mtm" (
    "search_id" bigint not null,
    "created_at" timestamp with time zone not null default now(),
    "customer_id" uuid not null
);


