CREATE OR REPLACE FUNCTION public.sync_auth_user_public_profile()
 RETURNS trigger
 LANGUAGE plpgsql
 SECURITY DEFINER
AS $function$
BEGIN    
    IF EXISTS (SELECT 1 FROM public.public_profile WHERE id = NEW.id) THEN
        UPDATE public.public_profile
        SET            
            email = NEW.email,
            email_confirmed_at = NEW.email_confirmed_at,
            phone = NEW.phone,
            phone_confirmed_at = NEW.phone_confirmed_at
        WHERE id = NEW.id;
    ELSE
        INSERT INTO public.public_profile (id, email, email_confirmed_at, phone, phone_confirmed_at)
        VALUES (NEW.id, NEW.email, NEW.email_confirmed_at, NEW.phone, NEW.phone_confirmed_at);
    END IF;
    RETURN NEW;
END;
$function$
;

